int sokhonggiam(int n){
	if(n < 10){
		return 0;
	}
	int x = n % 10;
	n = n / 10;
	int y;
	while(n > 0){
		y = n % 10;
		if(y > x){
			return 0;
		}
		x = y;
		n = n / 10;
	}
	return 1;
}

